import React, { useState } from 'react'
import './Form.css'
import { useNavigate } from 'react-router-dom'


const Form = () => {
const [name, setName]= useState('')
const [email, setEmail]= useState('')

  const handleName = (e)=>{
    setName(e.target.value)
  }
  
  const handleEmail = (e)=>{
    setEmail(e.target)
  }

    const navigate = useNavigate()
  return (
    <div className='container'>
         <button className="view" onClick={()=>{navigate('display')}}>View Lists</button>
     <form className='form'>
        <input type="text" onChange={handleName} value={name} placeholder='Name'/>
        <input type="email" onChange={handleEmail} placeholder='Email' />
        <input type="mobile" placeholder='Mobile' />
        <input type="text" placeholder='Address' />
     </form>
     <button type="submit" className='submit'>Submit</button>
    </div>
  )
}

export default Form
